import React from 'react';
import { Route } from 'react-router-dom';
import logo from'./logo.png';
import ListItem from './components/ListItem.js';

function App() {
  return (
    <div >
      <img src = {logo} className = 'logo' alt='' 
           style={{position: 'absolute', left: '0', top: '0', width: '400px', height: '150px'}}/>
      <div>
        <Route path='/components' exact component={ListItem}></Route>
      </div>
    </div>
  );
}

export default App;
